import React from "react";


import { makeStyles } from "@material-ui/core/styles";
import { ThemeProvider, Typography } from "@material-ui/core";
import * as Constants from "../../../constants";
import Image from "../../atoms/_image/_image"
const useStyles = makeStyles((theme) => ({
  styleHeaderElement: {
    height: "92.5vh",

    backgroundImage:
      "URL(https://www.xmple.com/wallpaper/gradient-cyan-purple-linear-2736x1824-c2-0bfce2-ee82ee-a-105-f-14.svg)",
    backgroundPosition: "center",
    backgroundRepeat: "noRepeat",
    backgroundSize: "cover",
  },
  picture: {
    backgroundImage:
      "URL(https://thumbs.dreamstime.com/b/young-woman-avatar-cartoon-character-profile-picture-young-brunette-woman-short-hair-avatar-cartoon-character-vector-149728784.jpg)",
    backgroundSize: "cover",
    width: "200px",
    height: "200px",
    marginTop: "50px",

    marginLeft: "auto",

    marginRight: "auto",
  },
}));

const HomeMainContent = () => {
  const classes = useStyles();
  return (
    <div className={classes.styleHeaderElement}>
      <Typography variant="h4">{Constants.NAME}</Typography>
      <Typography variant="subtitle1">{Constants.DESIGNATION}</Typography>
      {/* <div className={classes.picture}></div> */}
      <Image url="https://thumbs.dreamstime.com/b/young-woman-avatar-cartoon-character-profile-picture-young-brunette-woman-short-hair-avatar-cartoon-character-vector-149728784.jpg" height="200px" width="200px"></Image>
    </div>
  );
};

export default HomeMainContent;
